      <section className='footer-subscription'>
        <p className='footer-subscription-heading' style={{ fontFamily: 'Futura, sans-serif' }}>
          Contact Us
        </p>
        <p className='footer-subscription-text'>
          hello@policypulse.institute
        </p>
      </section>
      <section class='social-media'>
        <div class='social-media-wrap'>
          <div class='footer-logo' style={{ fontFamily: 'Futura, sans-serif' }}>
            <Link to='/' className='social-logo'>
              POLICY PULSE
            </Link>
          </div>
          <small class='website-rights'>POLICY PULSE Â© 2023 All rights reserved.</small>
        </div>
      </section>
    </div>
  );
}

export default Footer;
